		//פונקציית הטיקר
		function tick() {
			if (createjs.Ticker.paused == false) {
				stage.getChildByName("duck").x -= directionX * speed;
				if (stage.getChildByName("duck").x < -250) {
					//הסרת הליסנר כדי למנוע כפילויות במידה ולא הוסר לפני
					/*			stage.getChildByName("duck").removeEventListener("click", duckShoot);*/
		
					//הסרת מסיח לא נכון מהמערך
					stage.getChildByName("duck").x = stageWidth + 160;
		
					//החלפת מסיח
					//בדיקה האם עדיין יש פריטים בערך וגם בדיקה שכל התשובות הנכונות עדיין לא נבחרו
					if (itemsArray.length > 0 /*&& !(totalCorrects == correctCounter)*/ ) {
		
						if (!isSelected) { //בדיקה שתשובה פוספסה ולא נבחרה
							//הפעלת סאונד אי הצלחה
							playbadsound = createjs.Sound.play("loseSound");
							missCorrect++;
							console.log("תשובות שפוספסו עד כה: " + missCorrect);
							missedFirst.push(itemsArray[randQuestion][0]);
							console.log(missedFirst);
						}
		
						//החלפת מסיח
						randQuestion = Math.floor(Math.random() * itemsArray.length);
						changeItem(randQuestion);
						stage.getChildByName("duck").gotoAndStop(0);
						/*				console.log(isTrue);*/
		
						//הוספת הליסנר מחדש אחרי סיום הסיבוב
						stage.getChildByName("duck").getChildByName("correct").addEventListener("click", correctFunc);
						stage.getChildByName("duck").getChildByName("incorrect").addEventListener("click", incorrectFunc);
					} else {
						console.log("game over");
						gameover();
					}
				}
			}
			if (isStarted) { //בדיקה שמהמשחק התחיל
				//שליטה בכוונת שתזוז עם העכבר
				var pt = stage.globalToLocal(stage.mouseX, stage.mouseY);
				//בדיקה כדי להמנע מכך שהכוונת תופיע בהתחלה על 0,0
				if (pt.x > 0 && pt.y > 0) {
					stage.getChildByName("cross").x = pt.x;
					stage.getChildByName("cross").y = pt.y;
				}
			}
		}
		
		
